function App() { //Componente como uma função que retorana um html

  let counter = 0;
  function increment(){
    counter++;
  }

  return (
    <div className="App">
      <div>
        contador:{counter}
      </div>
      <button onClick={increment}>Incrementar</button>
    </div>
  );
}

export default App;
